We got to witness history in the making!! 

The Missouri film office has come together to invest in the future of film production. The Senate bill 94 passed and has officially been in effect since August 28, 2023. This bill creates an opportunity for film and television companies to apply for a tax incentive where a percentage of their spending will qualify. 

Venegeful is one the first films to gain access to this tax incentive. It was super dope to experience a very well written and directed film. From the visuals to the actors, I was very impressed! They killed it! 

Congratulations to those who play a role in the film industry. Y’all are continuing to put the city and this state as a whole on the map! Big things are happening right in our city. I love to see the growth! We’ve earned it! 

@bredaytonsoldit You are a true inspiration to many. One thing you’re gonna do is follow your dreams and make a huge deal out of it. I admire that. You did your thing and we can’t wait to see you in more films! 🥳

@bobbyjonline The city will always be behind you. You’re one of the funniest but realest comedians, hosts, and leaders in our city. Thanks for bringing such a dope idea to life. We all could really resonate with the story! Keep ‘em coming!!! 🥂🌱🙌🏾
